        36.5 ℃
        <img src={ther.png}></img>
    </div>)
        }else
    temperature = parseFloat(temperature);
    if(temperature >= 36.5)
    return(
        <div style={{padding: 10, fontSize:'1.3rem', color:'green', fontWeight:'bold'}}>
            {temperature} ℃
            <img style={{maxWidth:'50%', height:'auto'}}src={ther}></img>
        </div>);
    else{
        return( <div style={{padding: 10, fontSize:'1.2rem', color:'red'}}>
        {temperature} ℃
        <img src={ther.png}></img>
        </div>)
    }



}

export default Rating;
